import React from 'react';
import './jsonbuilder.css';


const JSONBuilder = props => {
	const handleStartDrag = (ev) => {
		console.log(ev);
	}

	return(
		<div className={ `JSON-Builder` } onMouseDown={ handleStartDrag } onMouseMove={ handleStartDrag}>

		</div>
	);
}

export default JSONBuilder;
